import React from "react";
import "./App.css";

import { motion, useAnimation } from "framer-motion";
import { useEffect } from "react";

import "bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  const controls = useAnimation();

  useEffect(() => {
    controls.start((i) => ({
      opacity: 1,
      x: 0,
      transition: { delay: i * 3, duration: 5 },
    }));
  }, []);

  return <App />;
}

export default App;
